tinymce.PluginManager.add("sp_tpro_mce_button",(function(editor,url){editor.addButton("sp_tpro_mce_button",{text:!1,icon:!1,image:url+"/icon-32.png",tooltip:"Testimonial Pro",onclick:function(){editor.windowManager.open({title:"Insert Shortcode",width:400,height:100,body:[{type:"listbox",name:"listboxName",label:"Select Shortcode",values:editor.settings.spTPROShortcodeList}],onsubmit:function(e){editor.insertContent('[sp_testimonial id="'+e.data.listboxName+'"]')}})}})}));